[
{"title":"General Rules","body":"<div><div> New full membership shall be open to persons resident within a 3 mile radius of Boroughbridge. All applications must be made in writing to the Secretary, to be put before and passed by the committee. These members will be entitled to hold office of the club and be allowed to vote at the Annual General Meeting. </div>  <div> &nbsp; </div>  <div> Any full member having had 5 years continuous membership who moves outside the 3 mile radius shall retain their status as a full member, providing they do not allow their membership to lapse. </div>  <div> &nbsp; </div>  <div> Associate membership shall be open to persons outside the 3 mile radius. All applications must be made in writing to the Treasurer, to be put before and passed by the committee. </div>  <div> &nbsp; </div>  <div> A person so accepted outside the 3 mile radius shall be called an associate member and therefore cannot hold office of the club or vote at the Annual General Meeting. </div>  <div> &nbsp; </div>  <div> Membership shall run yearly from the 1st April to 31st March. A member should hold a current valid rod licence to fish throughout the year of membership. Failure to do so will result in immediate expul, 2~|sion from the club for the remainder of that year. An excluded member will have to apply to the committee for new membership, on which a vote will be taken. </div>  <div> &nbsp; </div>  <div> All subscription renewals will be due 1st April. No club book will be issued unless the new season licence number and licence issue date are submitted with the application/renewal form. </div>  <div> &nbsp; </div>  <div> The committee has the right to refuse any application for membership. </div>  <div> &nbsp; , 3~|</div>  <div> No persons shall be allowed to fish unless subscription has been paid. </div>  <div> &nbsp; </div>  <div> <div>All business concerning club waters to be dealt with by the committee. No matches to be booked with the committee's sanction.</div>   </div>  <div> &nbsp; </div>  <div> Any case of complaint to be submitted in writing via the Secretary to be put before the committee at their next meeting. </div>  <div>&nbsp;</div></div>","ruleType":0}

]

[
{"title":"General Rules","body":"<div><div> New full membership shall be open to persons resident within a 3 mile radius of Boroughbridge. All applications must be made in writing to the Secretary, to be put before and passed by the committee. These members will be entitled to hold office of the club and be allowed to vote at the Annual General Meeting. </div>  <div> &nbsp; </div>  <div> Any full member having had 5 years continuous membership who moves outside the 3 mile radius shall retain their status as a full member, providing they do not allow their membership to lapse. </div>  <div> &nbsp; </div>  <div> Associate membership shall be open to persons outside the 3 mile radius. All applications must be made in writing to the Treasurer, to be put before and passed by the committee. </div>  <div> &nbsp; </div>  <div> A person so accepted outside the 3 mile radius shall be called an associate member and therefore cannot hold office of the club or vote at the Annual General Meeting. </div>  <div> &nbsp; </div>  <div> Membership shall run yearly from the 1st April to 31st March. A member should hold a current valid rod licence to fish throughout the year of membership. Failure to do so will result in immediate expul, 2~|sion from the club for the remainder of that year. An excluded member will have to apply to the committee for new membership, on which a vote will be taken. </div>  <div> &nbsp; </div>  <div> All subscription renewals will be due 1st April. No club book will be issued unless the new season licence number and licence issue date are submitted with the application/renewal form. </div>  <div> &nbsp; </div>  <div> The committee has the right to refuse any application for membership. </div>  <div> &nbsp; , 3~|</div>  <div> No persons shall be allowed to fish unless subscription has been paid. </div>  <div> &nbsp; </div>  <div> <div>All business concerning club waters to be dealt with by the committee. No matches to be booked with the committee's sanction.</div>   </div>  <div> &nbsp; </div>  <div> Any case of complaint to be submitted in writing via the Secretary to be put before the committee at their next meeting. </div>  <div>&nbsp;</div></div>","ruleType":0}

]

