    {
        "LineNumber": 9137,
        "AttributeName": "Title",
        "AttributeValue": "Next working party now on river"
    },
    {
        "LineNumber": 9138,
        "AttributeName": "Date",
        "AttributeValue": "2022-05-14 11:02:38"
    },
    {
        "LineNumber": 9139,
        "AttributeName": "Body",
        "AttributeValue": "Next Saturday's working party (21st May)&nbsp;will now be held on the river at the Cricket Field rather than at the lake as previously advertised."
    },
    {
        "LineNumber": 9140,
        "AttributeName": "dbKey",
        "AttributeValue": "NewsItem:23e4b5a9-d50d-49e6-a46e-0166567e5371"
    },
    {
        "LineNumber": 9141,
        "AttributeName": "Title",
        "AttributeValue": "Temporary keepnet ban"
    },
    {
        "LineNumber": 9142,
        "AttributeName": "Date",
        "AttributeValue": "2022-05-14 11:57:04"
    },
    {
        "LineNumber": 9143,
        "AttributeName": "Body",
        "AttributeValue": "Keepnets are not allowed on Roecliffe Lake until further notice. This is in response to a major fish kill at a local lake that is used by members of this club. The ban will stay in place until the cause of the fish deaths is known. Two large dip-tanks have been setup in the car park. One is to be used to dip your landing and keepnets, the other is a clean water tank to rinse the nets. These will be used for tomorrow's match.<div><br></div><div>Please use the dip-tanks for your landing nets from now on. Once the keepnet ban has been lifted, please use the dip-tanks for your keepnets too.</div>"
    },
    {
        "LineNumber": 9144,
        "AttributeName": "dbKey",
        "AttributeValue": "NewsItem:435fd9d5-36e6-4fff-b8c7-2ed82a284a9f"
    },
    {
        "LineNumber": 9145,
        "AttributeName": "Title",
        "AttributeValue": "2022/23 Season Diary Available"
    },
    {
        "LineNumber": 9146,
        "AttributeName": "Date",
        "AttributeValue": "2022-02-01 12:37:59"
    },
    {
        "LineNumber": 9147,
        "AttributeName": "Body",
        "AttributeValue": "The diary for the 2022/23 season is now available on the website. This includes all matches, meetings and work parties. It can be viewed in the \"Diary of Events\" menu option. Note that it will display this seasons events (2021/22) until the new season begins but you can change that using the \"Season\" dropdown at the top of the diary page."
    },
    {
        "LineNumber": 9148,
        "AttributeName": "dbKey",
        "AttributeValue": "NewsItem:4d34a7e1-9929-4404-8e32-baa1f1749263"
    },
