        "LineNumber": 9151,
        "AttributeName": "Body",
        "AttributeValue": "Just a quick update on tomorrow’s club match, having just walked the full length of the river it as been decided to fish the final club match of this season at Roecliffe pond, this decision as not been taken lightly as I and many others would much prefer to fish the river, however the river is still running a bit high but the main problem is the state of the banks just walking down to the river is hard work threw the soft mud but the banks are covered in 3” of slop for want of a better word making it difficult and dangerous to get down to river level to fish, very sorry if members are disappointed but we have a duty of care to all attendees.<div>Many thanks kevin</div>"
    },
