    {
        "LineNumber": 9163,
        "AttributeName": "Body",
        "AttributeValue": "Just a quick update on this Sundays up and coming club match which was due to be held on the middle stretch of Ings lane, having walked the length it is far too overgrown to get enough fishable pegs to use, it will need a full working party to get it back usable. The <strong>club match will now be fished on the middle lane stretch at Ellenthorpe</strong> signs have been put up today so no pleasure fishing will be available on that length this Sunday the 7th of November, draw at the moment will be as usual just threw the gate on the flood bank if it changes I will let you all know via this page just depends on which pegs I decide to use, let’s hope the weather is not as bad as forecast and we manage to catch some fish."
