    {
        "LineNumber": 9171,
        "AttributeName": "Body",
        "AttributeValue": "<div>Just a quick update on this coming Sundays club match (30 Jan), due to works been carried out on Ings Lane the club match will now be fished on the cricket field length, it will be pegged between peg 1 and peg 30 so no pleasure or day ticket fishing will be available on that stretch, draw will take place down the river under the conker tree at 8.30am.</div><div><br></div>"
    },
    {
        "LineNumber": 9172,
        "AttributeName": "dbKey",
        "AttributeValue": "Rules:2e87aeb5-f1ee-4ca5-bf99-3c93af8e52a8"
    },
    {
        "LineNumber": 9173,
        "AttributeName": "Title",
        "AttributeValue": "Junior / Intermediate Member - Match Rules"
    },
    {
        "LineNumber": 9174,
        "AttributeName": "Body",
        "AttributeValue": "0~|<p><b>Draw at 12.30pm - Fish 1.00pm - 4.00pm</b></p><ol><li><p>A Junior/Intermediate member shall only be allowed to fish matches if accompanied by one of the named persons on their disclosure form. The named person must carry ID as proof of identity.</p></li><li><p>During any match, the named (responsible) person must accompany the Junior/Intermediate angler throughout the duration of the match and at no time must the Junior/Intermediate be left unsupervised.</p></li><li><p>The named person attending the match is totally responsible for the persons in their charge.</p></li><li><p>No Junior/Intermediate can enter any match pools in either Junior or Senior matches.</p></li><li><p>A series of matches, with no entry fee, are fished each year for trophies. Non-cash prizes will be awarded.</p></li><li><p>Casting can be done by the accompanying adult, but the rod must then be immediately passed to the junior angler:</p></li><li><p>There are no feeding restrictions concerning the adult.</p></"
    },
    {
        "LineNumber": 9175,
        "AttributeName": "Body",
        "AttributeValue": "1~|li><li><p>When reeling in and landing a fish ALL juniors must have one hand on the rod with their other hand on the reel. An adult may only help by the supporting of and the raising of the rod itself and may assist with all aspects of netting and unhooking of the fish.</p></li><li><p>ANY fish hooked by an adult MUST be immediately and freely returned to the water.</p></li><li><p>Rules for Potters Pond matches:</p><p>- Barbless hooks only & NO ground bait</p></li></ol>"
    },
    {
        "LineNumber": 9176,
        "AttributeName": "RuleType",
        "AttributeValue": "3"
    },
    {
        "LineNumber": 9177,
        "AttributeName": "dbKey",
        "AttributeValue": "Rules:60efdcb7-fc98-4853-9e47-2bd10e747a85"
    },
    {
        "LineNumber": 9178,
        "AttributeName": "Title",
        "AttributeValue": "Junior / Intermediate Member - General Rules"
    },
    {
        "LineNumber": 9179,
        "AttributeName": "Body",
        "AttributeValue": "0~|<p><b>Membership for Juniors is FREE up to the age of 12 years.</b></p><ol><li><p>A Junior/Intermediate disclosure form must be completed. when applying for club membership. No disclosure form - no membership.</p></li><li><p>All juniors must be accompanied by a nominated person or persons from their disclosure form whilst fishing at the following venues:</p><p>- Ellenthorpe Hall</p><p>- Ellenthorpe Lodge</p><p>- Roecliffe Ponds</p><p>This rule must apply for the duration of the time spent fishing on any one day.</p></li><li><p>A Junior/Intermediate member is classed as a junior up to the 1st of April following their 16th birthday. On 1st April after their 16th birthday, they will be classed as an Intermediate up to the 1st January following their 18th birthday.</p></li><li><p>Parents of Junior/Intermediate members must purchase a key for the Roecliffe Pond gate. This carries a deposit of £5.00 which is fully refundable upon request and return of the key, if the membership should not be"
    },
    {
        "LineNumber": 9180,
        "AttributeName": "Body",
        "AttributeValue": "1~| renewed.</p></li><li><p>All Junior/Intermediate members are expected to abide by club rules and be of good conduct when fishing.</p></li></ol>"
    },
    {
        "LineNumber": 9181,
        "AttributeName": "RuleType",
        "AttributeValue": "2"
    },
    {
        "LineNumber": 9182,
        "AttributeName": "dbKey",
        "AttributeValue": "Rules:7c005701-5446-4433-a9c6-3ddd77464c2f"
    },
    {
        "LineNumber": 9183,
        "AttributeName": "Title",
        "AttributeValue": "General Rules"
    },
    {
        "LineNumber": 9184,
        "AttributeName": "Body",
        "AttributeValue": "0~|<ol><li><p>New full membership shall be open to persons resident within a 3 mile radius of Boroughbridge. All applications must be made in writing to the Secretary, to be put before and passed by the committee. These members will be entitled to hold office of the club and be allowed to vote at the Annual General Meeting.</p><p>Any full member having had 5 years continuous membership who moves outside the 3 mile radius shall retain their status as a full member, providing they do not allow their membership to lapse.</p></li><li><p>Associate membership shall be open to persons outside the 3 mile radius. All applications must be made in writing to the Treasurer, to be put before and passed by the committee.</p><p>A person so accepted outside the 3 mile radius shall be called an associate member and therefore cannot hold office of the club or vote at the Annual General Meeting.</p></li><li><p>Membership shall run yearly from the 1st April to 31st March. A member should hold a current valid"
    },
    {
        "LineNumber": 9185,
        "AttributeName": "Body",
        "AttributeValue": "1~| rod licence to fish throughout the year of membership. Failure to do so will result in immediate expulsion from the club for the remainder of that year. An excluded member will have to apply to the committee for new membership, on which a vote will be taken.</p></li><li><p>All subscription renewals will be due 1st April. No club book will be issued unless the new season licence number and licence issue date are submitted with the application/renewal form.</p></li><li><p>The committee has the right to refuse any application for membership.</p></li><li><p>No persons shall be allowed to fish unless subscription has been paid.</p></li><li><p>All business concerning club waters to be dealt with by the committee. No matches to be booked with the committee's sanction.</p></li><li><p>Any case of complaint to be submitted in writing via the Secretary to be put before the committee at their next meeting.</p></li><li><p>Committee meet at headquarters as per diary. Five to form a quorum.</p></li>"
    },
    {
        "LineNumber": 9186,
        "AttributeName": "Body",
        "AttributeValue": "2~|<li><p>Annual General Meeting will be held at 8.00 pm at the club's headquarters. Refer to club diary for actual date. (Dates may differ due to circumstances and to which you will be notified).</p><p>Notice of motions for the agenda to be submitted to the Secretary in writing one week before the Annual General Meeting with a proposer and seconder's signature.</p></li><li><p>No member may receive a trophy if found to break any of the club's rules. Should any question arise upon which the club rules do not touch, the committee have power to deal with it.</p></li><li><p>The club shall not amalgamate with any other organisation.</p></li><li><p>No day tickets on the river during the close season.</p></li><li><p>A full member may take one guest on any water providing that the adult member has obtained a guest ticket in advance and subsequently had both ticket and counterfoil signed by the adult member, including own member's book number. Members must fish with guest and be responsible for th"
    },
    {
        "LineNumber": 9187,
        "AttributeName": "Body",
        "AttributeValue": "3~|eir conduct. Match lengths are NOT available on match days. Guest tickets are available to all full and associate adult members, from Bailey's Newsagents, Horsefair, Boroughbridge and Pybus Newsagent, High Street, Boroughbridge.</p></li><li><p>Keep to footpaths, do not wander from banks, close all gates, do not climb walls.</p></li><li><p>Keep clear of growing crops, meadows, farm stock etc.</p></li><li><p>No cars etc., allowed to enter meadows. No camping. No erection of tents or fires.</p></li><li><p>No dogs allowed to accompany members fishing.</p></li><li><p>No rubbish to be left on river banks.</p></li><li><p>Protect your fishing - <i>it is in your own interest.</i></p></li><li><p>It is the duty of all members to report any infringement the secretary or any committee member. </p></li><li><p>No fish to be taken at any time.</p></li><li><p>No music devices etc., to be played on the river bank.</p></li><li><p>No night fishing.</p></li></ol><b>PLEASE NOTE:</b><p>In return for away mat"
    },
    {
        "LineNumber": 9188,
        "AttributeName": "Body",
        "AttributeValue": "4~|ches granted to our club by other clubs, it is possible that our own water may be booked in return. As this situation may occur after going to print, we apologise for any inconvenience.</p>"
    },
    {
        "LineNumber": 9189,
        "AttributeName": "RuleType",
        "AttributeValue": "0"
    },
    {
        "LineNumber": 9190,
        "AttributeName": "dbKey",
        "AttributeValue": "Rules:d5ee0a4c-8e5a-49a2-a603-ebb989c2bdf4"
    },
    {
        "LineNumber": 9191,
        "AttributeName": "Title",
        "AttributeValue": "Match Rules"
    },
    {
        "LineNumber": 9192,
        "AttributeName": "Body",
        "AttributeValue": "0~|<p><b>Draw 8.30am prompt</b></p><p>- Anyone arriving late to the draw commencing WILL NOT be eligible to fish, unless the match/sec has been informed prior to match draw time.</p><p>- Duration of match to be announced on the day Sweeps optional (Junior Members: See Junior Rules)</p><br/><ol><li><p>One rod, one hook, one line, or one pole. All other poles/rods not in use, must be on clear view on the bank, behind the competitor. No bait boats. No doubles or treble hooks.</p></li><li><p>Keep nets must be used to N.R.A. specification. All fish to be returned alive.</p></li><li><p>All live fish weigh, with the exception of pike and game fish.</p></li><li><p>Competitors may assist each other in netting or landing fish.</p></li><li><p>Before the starting signal no competitor must on any account, ground bait or loose feed his swim, but will be allowed to wet a line, plumb the depth and test the float, mix ground bait, clear his fishing ground of weed or obstructions and position his keep net."
    },
    {
        "LineNumber": 9193,
        "AttributeName": "Body",
        "AttributeValue": "1~| On no account must a feeder be used to plumb the depth before the starting signal.</p></li><li><p>Competitors must fish at peg drawn and under no circumstances be allowed to change pegs.</p></li><li><p>Competitors must not move more than one yard each side of their peg to fish. No artificial baits, lures, or the use of any fish finding devices during a match.</p></li><li><p>Competitors must not fish below the next peg, drawn or not, nor cast or throw feed into swim above.</p></li><li><p>A competitor may wade, provided that at no time the water level extends above knee height.</p></li><li><p>A competitor must cease fishing at the finishing signal. Should he still be playing a fish hooked before the signal is given, he must shout &#34;Fish On&#34; and then he will be permitted not more than fifteen minutes after time has been called, to land and net the fish.</p></li><li><p>Any angler withdrawing from a match must leave the match area and not start re-fishing in any undrawn peg in the m"
    },
    {
        "LineNumber": 9194,
        "AttributeName": "Body",
        "AttributeValue": "2~|atch stretch.</p></li><li><p>Any competitor leaving his peg must withdraw tackle from water. Failing to comply will lead to disqualification.</p></li><li><p>Any competitor having paid entry fee and sweeps cannot have a refund after the draw.</p></li><li><p>All fish tendered to scales become the property of the match officials, who will witness the careful return of such fish to the water.</p></li><li><p>The signal for start and finish of the match will be given by the match official on the day. This must then be passed down by the competitors.</p></li><li><p>Any objection to any competitor shall be made to the match official during the match. The complainant' shall also follow up any verbal complaint, in writing, to the club committee. Any prize money will be withheld pending their decision. The competitor concerned shall have the right to appear before the match committee, when the case is discussed.</p></li><li><p>Any competitor breaking any rules will be disqualified.</p></li><li><p"
    },
    {
        "LineNumber": 9195,
        "AttributeName": "Body",
        "AttributeValue": "3~|>All matches, except fur and feather, opens and officials will count for aggregate trophy.</p></li><li><p>No club trophies can be won outright.</p></li><li><p>Competitors are responsible for ensuring that their pegs are clear of all litter and no competitor may have his catch weighed in, who has litter lying on the banks of his swim.</p></li><li><p>All the clubs General Rules also apply to matches.</p></li><li><p>Two match committee members shall be nominated for the morning of each match, to act as that days' officials, as required.</p></li></ol>"
    },
