    {
        "LineNumber": 9221,
        "AttributeName": "Description",
        "AttributeValue": "0~|<b>Note: This is a site of Importance for Nature Conservation</b><br/><br/>Rules<ul class='rule-list'><li>Keep to the footpaths around the ponds. No trespassing from the paths as you will disturb the wildlife.</li><li>NO DOGS allowed at ANY TIME as they will disturb the wildlife.</li><li>NO night fishing (after daylight).</li><li>NO boilies to be used at any time.</li><li>NO camping or fires of any kind.</li><li>NO fish to be taken for any purpose.</li><li>Fishing from permanent pegs only.</li></ul><br/>Fishing visitors are allowed but only with a full or associate member who must have obtained a guest ticket in advance and the counterfoil must be signed by the club member.<br/><br/>When asked to produce your book for proof of membership, you will also be asked to show your numbered gate key.<br/><br/>Any person failing to produce a valid gues ticket or their member's book on request, will be ordered off the site.<br/><br/>On occasion the pond may be closed for educational visits."
    },
    {
        "LineNumber": 9222,
        "AttributeName": "Directions",
        "AttributeValue": "0~|Entry is via first lane on the left after Beckland's Industrial Estate, then right at the end.<br/><br/>Park in the fenced-off area taking care not to obstruct the public footpath. Use your keys to enter the ponds through the small gate. If you are a disabled angler - open the large gate and park inside. <br/><br/>Please LOCK the gate after each entry and exit."
