    {
        "lineNumber": 405,
        "attributeName": "Description",
        "attributeValue": "0~|<div><strong>Note: This is a site of Importance for Nature Conservation</strong></div><div><br></div><div><br></div>Rules<ul><li>Keep to the footpaths around the ponds. No trespassing from the paths as you will disturb the wildlife.</li><li>NO DOGS allowed at ANY TIME as they will disturb the wildlife.</li><li>NO night fishing (after daylight).</li><li>NO boilies to be used at any time.</li><li>NO camping or fires of any kind.</li><li>NO fish to be taken for any purpose.</li><li>Fishing from permanent pegs only.</li></ul><div><br></div><div>Fishing visitors are allowed but only with a full or associate member who must have obtained a guest ticket in advance and the counterfoil must be signed by the club member.</div><div><br></div><div>When asked to produce your book for proof of membership, you will also be asked to show your numbered gate key.</div><div><br></div><div>Any person failing to produce a valid guest ticket or their member's book on request, will be ordered off the site.</"
    },
    {
        "lineNumber": 406,
        "attributeName": "Description",
        "attributeValue": "1~|div><div><br></div>On occasion the pond may be closed for educational visits."
    },
