        "attributeValue": "54.0874351912413,-1.41015610915912"
    },
    {
        "lineNumber": 408,
        "attributeName": "Directions",
        "attributeValue": "0~|Entry is via first lane on the left after Beckland's Industrial Estate, then right at the end.<br/><br/>Park in the fenced-off area taking care not to obstruct the public footpath. Use your keys to enter the ponds through the small gate. If you are a disables angler - open the large gate and park inside. <br/><br/>Please LOCK the gate after each entry and exit."
